import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from "./components/Home";

class App extends Component {
  render() {
    return (
      <Router>
        <Home></Home>
        <Route exact path="/" Component={Home}></Route>
      </Router>
    );
  }
}

export default App;
